import React from 'react';

const icons = {  
  'default': 'data:img/png;base64,',

  'develop': 'data:img/png;base64,',
  'snippet': 'data:img/png;base64,',
  'study': 'data:img/png;base64,',
  'sun': 'data:img/png;base64,',
  'moon': 'data:img/png;base64,',
  'theory': 'data:img/png;base64,',
  'term': 'data:img/png;base64,',
  'note': 'data:img/png;base64,',
  'memo': 'data:img/png;base64,', 
  'error': 'data:img/png;base64,',
  'tool': 'data:img/png;base64,',
  'review': 'data:img/png;base64,', 
  'main': '',
}


export const Icon = ({ name, icon }) => {
  var viewBox = `0 0 ${icon.width} ${icon.height}`
 
  return(
    <svg xmlns="http://www.w3.org/2000/svg" width = {icon.width} height={icon.height} viewBox={viewBox}>
      <image width={icon.width} height={icon.height} href={icons[name]}/>
    </svg>
  )
}


